  // \u91CD\u7F6E\u6570\u636E\uFF0C\u4ECE\u7B2C\u4E00\u9875\u4EE5\u53CA\u9ED8\u8BA4\u7684\u5206\u9875\u6570\u91CF\u5F00\u59CB\u663E\u793A\u3001\u67E5\u8BE2\u6570\u636E
  onReset: () => void;
  // \u6839\u636E\u6761\u4EF6\uFF0C\u4ECE\u7B2C\u4E00\u9875\u4EE5\u53CA\u5F53\u524D\u7684\u5206\u9875\u6570\u91CF\u5F00\u59CB\u663E\u793A\u3001\u67E5\u8BE2\u6570\u636E
